import * as Yup from "yup";
import { createNewColorService } from "../../../services/CRUD_categoryService";
import swal from "sweetalert";

//====================== üìçinitialValues =====================
export const initialValues = {
  title: "",
  code: "#e66465",
};

//====================== üìçonSubmit ===========================
export const onSubmit = async (data) => {
  const res = await createNewColorService(data);
  if (res.status == 201) {
    swal("ÿ´ÿ®ÿ™ ÿ¥ÿØ", res.data.message, "success");
  }
};

//====================== üìçvalidationSchema ===================
export const validationSchema = Yup.object({});
